"use strict";(self.webpackChunkheidelbergman_site=self.webpackChunkheidelbergman_site||[]).push([[673],{7994:e=>{e.exports=JSON.parse('[{"id":"/2026/01/21/ausgebucht2","metadata":{"permalink":"/blog/2026/01/21/ausgebucht2","source":"@site/blog/2026-01-21-ausgebucht2.md","title":"Wir sind ausgebucht!","description":"Bild","date":"2026-01-21T00:00:00.000Z","formattedDate":"21. Januar 2026","tags":[],"hasTruncateMarker":false,"authors":[{"name":"Orga Team","title":"Heidelberg-Triathlon Orga Team","imageURL":"https://www.heidelberg-triathlon.de/img/logo/HDtri_round_mini.png","key":"orga"}],"frontMatter":{"title":"Wir sind ausgebucht!","authors":["orga"]},"unlisted":false,"nextItem":{"title":"Einzel-Startpla\u0308tze ausgebucht!","permalink":"/blog/2026/01/11/ausgebucht"}},"content":"![Bild](/blog/2026_01_21.png)\\n\\nWahnsinn! Ihr seid ja der Hammer!!! \ud83e\udd2f\\n\\nIn den letzten Tagen sind nun auch die letzten Staffelpla\u0308tze im Rekordtempo verkauft worden. \ud83d\udcc8\\nAusgebucht in nichtmal 3 Wochen, davon haben wir vor 2 Jahren noch getra\u0308umt. \ud83d\udcad\u2b50\\n\\nDanke fu\u0308r euer Vertrauen und dass ihr auch 2026 wieder genauso viel Bock auf den Heidelberg Triathlon habt wie wir. \ud83d\ude80\ud83d\udd25\\n\\nFu\u0308r alle, die es dieses Mal nicht geschafft haben einen Startplatz zu ergattern:\\nAus eigener Erfahrung ko\u0308nnen wir sagen: Helfen macht mindestens/fast genauso viel Spa\xdf wie Starten! \ud83d\ude4c\ud83c\udffc\\n\\nLiebe Gru\u0308\xdfe, euer Orga Team \ud83e\udef6\ud83c\udffc\\n\\n\ud83d\ude80 Race Day: 26.07.2026 \ud83d\ude80"},{"id":"/2026/01/11/ausgebucht","metadata":{"permalink":"/blog/2026/01/11/ausgebucht","source":"@site/blog/2026-01-11-ausgebucht.md","title":"Einzel-Startpla\u0308tze ausgebucht!","description":"Bild","date":"2026-01-11T00:00:00.000Z","formattedDate":"11. Januar 2026","tags":[],"hasTruncateMarker":false,"authors":[{"name":"Orga Team","title":"Heidelberg-Triathlon Orga Team","imageURL":"https://www.heidelberg-triathlon.de/img/logo/HDtri_round_mini.png","key":"orga"}],"frontMatter":{"title":"Einzel-Startpla\u0308tze ausgebucht!","authors":["orga"]},"unlisted":false,"prevItem":{"title":"Wir sind ausgebucht!","permalink":"/blog/2026/01/21/ausgebucht2"},"nextItem":{"title":"A\u0117ra wird Titelsponsor!","permalink":"/blog/2026/01/01/namessponsor"}},"content":"![Bild](/blog/2026_01_11.webp)\\n\\n\\nWOW! Dieses Jahr musstet ihr richtig schnell sein bei der Anmeldung \ud83e\udd2f\\n\\nWir freuen uns riesig, dass wir schon jetzt wieder alle Einzel-Startpla\u0308tze vergeben konnten!\\n\\nWenn ihr auch am 26. Juli dabei sein wollt: Es gibt noch Staffel-Startpla\u0308tze \ud83c\udfca\u200d\u2642\ufe0f\ud83d\udeb4\u200d\u2642\ufe0f\ud83c\udfc3\u200d\u2642\ufe0f\\nSchnappt euch Friends & Family und geht als Team an den Start \ud83e\udef6\\n\\nFreut euch alle auf ein sportliches Spektakel in Heidelberg \ud83d\ude80\\n\\n#heidelbergtriathlonbyaera #heidelbergtriathlon #swimbikerun #heidelberg #teamrelay"},{"id":"/2026/01/01/namessponsor","metadata":{"permalink":"/blog/2026/01/01/namessponsor","source":"@site/blog/2026-01-01-namessponsor.md","title":"A\u0117ra wird Titelsponsor!","description":"Bild","date":"2026-01-01T00:00:00.000Z","formattedDate":"1. Januar 2026","tags":[],"hasTruncateMarker":false,"authors":[{"name":"Orga Team","title":"Heidelberg-Triathlon Orga Team","imageURL":"https://www.heidelberg-triathlon.de/img/logo/HDtri_round_mini.png","key":"orga"}],"frontMatter":{"title":"A\u0117ra wird Titelsponsor!","authors":["orga"]},"unlisted":false,"prevItem":{"title":"Einzel-Startpla\u0308tze ausgebucht!","permalink":"/blog/2026/01/11/ausgebucht"},"nextItem":{"title":"Anwohner-Infos und Strecken-Sperrungen","permalink":"/blog/2025/07/16/_AnwohnerInfos"}},"content":"![Bild](/blog/2026_01_01.webp)\\n\\n\\n\ud83e\udd1dA\u0117ra wird Titelsponsor des Heidelberg Triathlon 2026!\\n\\nNach zwei Jahren erfolgreicher Zusammenarbeit freuen wir uns euch @aera_fitness als neuen Titelsponsor f\xfcr das Jahr 2026 pr\xe4sentieren zu d\xfcrfen!\\n\\nDas Team von A\u0117ra trefft ihr an ihrem Stand auf unserer Expo, in der Fanzone auf der alten Br\xfccke und nat\xfcrlich in ihrem Studio in Heidelberg Rohrbach.\\nDurch eine individuelle Trainingsbetreuung zeigt euch das Team von A\u0117ra die ersten Schritte zu einem erfolgreichen & gesunden Training, hilft erfahrenen Sportler*innen ihre Potenziale freizusetzen und bereitet professionelle Athlet*Innen auf Wettk\xe4mpfe vor.\\n\\nWir bedanken uns f\xfcr das Vertrauen und den Support unseres Triathlons \u2764\ufe0f"}]')}}]);